import React from 'react';
import ReactDOM from 'react-dom/client';
import Button from '@mui/material/Button';
import  Field  from './Field';
import  {Links}  from './Links';
import { Box } from '@mui/material';
function ButtonUsage() {
    return <Button variant="contained">Login</Button>;
  }


export default  class Forms extends React.Component{
    constructor(props){
      super(props)
    }
    render()
    {
      const {sx,name,type}=this.props
      return(
        <Box
        component="form"
        sx={{
          '& .MuiTextField-root': { m: 1, width: '25ch' },
        }}
        noValidate
        autoComplete="off"
        >
          <Field name='username' label='Username' type='text'/>
          <Field name='passsword' label='Password' type='password'/>
          <Links text="Forgot your passwords" underline="none" color='blue'/>
          <ButtonUsage/>
        </Box>

      )
    }
  }


